Description:

A Rock Band is nothing without its hard rocking and faithful roadies. The band needs their roadies to set up the equipment before every show and ensure that the stage is set before they perform. Sometimes the nonstop traveling and endless parties take their toll on the roadies and they sleep through the opening act. This doesn't give them much time to deliver the band's equipment to the stage. And if the band doesn't have their equipment they can't perform.
